Description:
Tôi có 1 cái script bán sách ( có hướng dẫn sử dụng ) , cái này được thiết kế để bỏ vào root folder của 1 domain. Nó sử dụng cổng thanh toán paypal. Nhận data từ Paypal IPN để load các trang sau khi người ta thanh toán , ví dụ như sau khi mua thì người ta được dẫn đến 1 trang để download. 
Giờ tôi muốn cài script này trong nhiều sub folders. Để bán nhiều sách hơn. 
Ví dụ mydomain.com/sach1 , mydomain.com/sach2 , mydomain.com/sach3 . 
Vấn đề là Paypal nó chỉ cho set 1 đường dẫn duy nhất để gửi thông báo về website nên tôi chỉ có thể nhập 1 đường dẫn duy nhất trỏ vào root website folder. http://mydomain.com/ipn.php. Data sau khi thanh toán sẽ được gửi cho ipn mẹ đọc rồi phân phối cho IPN con trong subfolders ( sach1,sach2, sach3 ...), từ đó sẽ xử lý các bước tiếp theo. 
Code gốc trong file đính kèm , còn đây là code ipn mẹ ( có thể dùng lấy ý tưởng ) 
<?php 
$req = 'cmd=_notify-validate'; 
file_put_contents('test.txt', json_encode($_POST)); 
foreach ($_POST as $key => $value) { 
 $value = urlencode(stripslashes($value)); 
 $req .= "&$key=$value"; 
} 
$ch = curl_init(); 
$item_number = explode("-", stripslashes($_POST['item_number']))[0]; 
curl_setopt($ch, CURLOPT_URL, "https://fivetipsforyou.com/" . $item_number . "/ipn.php"); 
curl_setopt($ch, CURLOPT_POST, 1); 
curl_setopt($ch, CURLOPT_POSTFIELDS, $req); 
curl_setopt($ch, CURLOPT_HTTPHEADER, array('Content-Type: application/x-www-form-urlencoded')); 
curl_setopt($ch, CURLOPT_RETURNTRANSFER, true); 
$server_output = curl_exec($ch); 
if ($server_output === false) { 
 // Log cURL error 
 $error = curl_error($ch); 
 error_log("cURL Error: $error", 3, 'error_log.txt'); 
} else { 
 echo $server_output; 
} 
curl_close($ch); 
?> 
Sau khi thanh toán thì tôi bị lỗi kiểu như ipn con nó ko nhận dc data từ paypal thong qua ipn mẹ ( check file đính kèm)

